/** @format */

import {
  Grid,
  Typography,
  Box,
  FormLabel,
  MenuItem,
  TextField,
} from "@mui/material";
import React, { Fragment } from "react";
import MatterList from "./components/MatterList";

const MatterDashboard = () => {
  return (
    <Fragment>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          "& > :not(style)": { m: 1 },
        }}
      >
        <Grid container>
          <Grid item>
            <MatterList />
          </Grid>
          <Grid item>
            <Grid container>
              <Grid item>Tasks Cleared Last day</Grid>
              <Grid item>Goal Today</Grid>
            </Grid>
          </Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default MatterDashboard;
